52870e0d383c86550\", \"class_name\": \"RelatedNodeInfo\"}, \"3\": {\"node_id\": \"7b3943fd-0f4c-46c4-9b57-0a5e43dd95dd\", \"node_type\": \"1\", \"metadata\": {}, \"hash\": \"8d73f4aefd3532a0c1589688a6f62d7263080a20ea7dfe30f7baed501f33eecc\", \"class_name\": \"RelatedNodeInfo\"}}, \"text\": \"We\\tbelieve\\tthe\\tITA\\u2019s\\tposition\\tis\\twithout\\tmerit,\\twe\\tare\\tdefending\\tour\\tposition\\tvigorously\\tin\\tthe\\nIndian\\tcourts,\\tand\\twe\\texpect\\tto\\trecoup\\ttaxes\\tpaid.\\tIf\\tthis\\tmatter\\tis\\tadversely\\tresolved,\\twe\\tcould\\trecognize\\tsignificant\\tadditional\\ttax\\texpense,\\tincluding\\tfor\\ttaxes\\npreviously\\tpaid.\\nIn\\tOctober\\t2014,\\tthe\\tEuropean\\tCommission\\topened\\ta\\tformal\\tinvestigation\\tto\\texamine\\twhether\\tdecisions\\tby\\tthe\\ttax\\tauthorities\\tin\\tLuxembourg\\twith\\tregard\\tto\\tthe\\ncorporate\\tincome\\ttax\\tpaid\\tby\\tcertain\\tof\\tour\\tsubsidiaries\\tcomply\\twith\\tEuropean\\tUnion\\trules\\ton\\tstate\\taid.\\tOn\\tOctober\\t4,\\t2017,\\tthe\\tEuropean\\tCommission\\tannounced\\tits\\ndecision\\tthat\\tdeterminations\\tby\\tthe\\ttax\\tauthorities\\tin\\tLuxembourg\\tdid\\tnot\\tcomply\\twith\\tEuropean\\tUnion\\trules\\ton\\tstate\\taid.\\tBased\\ton\\tthat\\tdecision,\\tthe\\tEuropean\\nCommission\\tannounced\\tan\\testimated\\trecovery\\tamount\\tof\\tapproximately\\t\\u20ac\\n250\\n\\tmillion,\\tplus\\tinterest,\\tfor\\tthe\\tperiod\\tMay\\t2006\\tthrough\\tJune\\t2014,\\tand\\tordered\\nLuxembourg\\ttax\\tauthorities\\tto\\tcalculate\\tthe\\tactual\\tamount\\tof\\tadditional\\ttaxes\\tsubject\\tto\\trecovery.\\tLuxembourg\\tcomputed\\tan\\tinitial\\trecovery\\tamount,\\tconsistent\\twith\\tthe\\nEuropean\\tCommission\\u2019s\\tdecision,\\twhich\\twe\\tdeposited\\tinto\\tescrow\\tin\\tMarch\\t2018,\\tsubject\\tto\\tadjustment\\tpending\\tconclusion\\tof\\tall\\tappeals.\\tIn\\tDecember\\t2017,\\nLuxembourg\\tappealed\\tthe\\tEuropean\\tCommission\\u2019s\\tdecision.\\tIn\\tMay\\t2018